import React from 'react';

const items = [
    {
        id: p1,
        name: Alika,
        price: 350,
        Quantity: 500,
    },
    {
        id: p2,
        name: Azec,
        price: 300,
        Quantity: 500,
    },
    {
        id: p3,
        name: Korajan,
        price: 450,
        Quantity: 500,
    },
    {
        id: p4,
        name: Profex,
        price: 250,
        Quantity: 500,
    }
];
const AvailableItems = () => {
    const Items = items.map(item => <li>item.name</li>)
    return (
        <ul>
            {Items}
        </ul>

    )
}
export default AvailableItems;
